import React from 'react';
import HeaderDropdown from '../HeaderDropdown/HeaderDropdown'

function HeaderNavbar() {

    const headerNavbar = [
        {
            title: 'О нас',
            link: '/'
        },
        {
            title: 'Портфолио',
            link: '/'
        },
        {
            title: 'Контакты',
            link: '/'
        },
        {
            title: 'Этапы проекта',
            link: '/'
        },
        {
            title: 'Заказать проект',
            link: '/'
        },
    ]
        return (
        <div className='header__navbar'>
            <HeaderDropdown/>
            <a class="header__navbar-item" href="/">Портфолио</a>
            <a class="header__navbar-link" href="/">Контакты</a>
            <a class="header__navbar-link" href="/">Цены</a>
        </div>
    )
}

export default HeaderNavbar;
